import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.scss';

const Navbar = () => {
    return (
        <nav>
            <ul>
                <li>
                    <Link to="/">Home</Link>
                </li>
                <li>
                    <Link to="/contactUs">Contact Us</Link>
                </li>
            </ul>
        </nav>
    );
}

export default Navbar;
